import MenuTap from "./MenuTap";
import axios from "axios";

function Menu() {
  //make a request for a user with a given ID
  const test = async () =>
    await axios
      .post("http://127.0.0.1:8000/")
      .then(function (response) {
        // handle success
        console.log(response);
      })
      .catch(function (error) {
        // handle error
        console.log(error);
      });

  return (
    <>
      <MenuTap />
    </>
  );
}
export default Menu;
